//STYLES
const gridStyles = {
  height: "100%",
  width: "100%",
  display: "grid",
  placeItems: "center center",
};

const cardContainerStyles = {
  width: "100%",
  height: "100%",
  whiteSpace: "nowrap",
  overflowX: "scroll",
  perspective: "150px",
  msOverflowStyle: "none",
  scrollbarWidth: "none",
  overflow: "hidden",
};

const cardStyles = {
  position: "relative",
  top: "6.5rem",
  display: "inline-block",
  height: "60%",
  width: "20%",
  backgroundSize: "cover",
  backgroundRepeat: "no-repeat",
  backgroundPosition: "center center",
  margin: "2rem 1rem",
  borderRadius: "15px",
  cursor: "pointer",
};

const viewButtonStyles = {
  color: "#FFFFFF",
  fontFamily: "Poppins, sans-serif",
  fontWeight: 500,
  fontSize: "15px",
  lineHeight: "30px",
  transform: "rotateY(180deg)",
  borderColor: "#FFFFFF",
};

const buttonTextStyles = {
  color: "#FFFFFF",
  fontFamily: "Poppins, sans-serif",
  fontWeight: 500,
  fontSize: "15px",
  lineHeight: "30px",
};

const portofolioNameStyles = {
  color: "#FFFFFF",
  fontFamily: "Poppins, sans-serif",
  fontWeight: 500,
  fontSize: "15px",
  lineHeight: "30px",
};

//VARIANTS

const cardVariants = {
  selected: {
    rotateY: 180,
    scale: 1.1,
    transition: { duration: 0.35 },
    zIndex: 10,
    boxShadow:
      "rgba(0, 0, 0, 0.1) 0px 10px 15px -3px, rgba(0, 0, 0, 0.05) 0px 4px 6px -2px",
  },

  notSelected: (i) => ({
    rotateY: i * 15,
    scale: 1 - Math.abs(i * 0.15),
    x: i ? i * 50 : 0,
    opacity: 1 - Math.abs(i * 0.15),
    zIndex: 10 - Math.abs(i),
    boxShadow:
      "rgba(0, 0, 0, 0.1) 0px 4px 6px -1px, rgba(0, 0, 0, 0.06) 0px 2px 4px -1px",
    transition: { duration: 0.35 },
  }),
};

const shadowVariants = {
  initial: {
    boxShadow: "0px 36px 32px 21px rgba(0,0,0,0.75) inset",
    WebkitBoxShadow: "0px 36px 32px 21px rgba(0,0,0,0.75) inset",
    MozBoxShadow: "0px 36px 32px 21px rgba(0,0,0,0.75) inset",
  },
  selected: {
    boxShadow: "14px 60px 189px -30px rgba(0,0,0,0.67) inset",
    WebkitBoxShadow: "14px 60px 189px -30px rgba(0,0,0,0.67) inset",
    MozBoxShadow: "14px 60px 189px -30px rgba(0,0,0,0.67) inset",
  },
};

const Flashcards = () => {
  const [selectedCard, setSelectedCard] = useState(null);

  const [{ startX, startScrollLeft, isDragging }, setDragStart] = useState({
    startX: undefined,
    startScrollLeft: undefined,
    isDragging: false,
  });

  const containerRef = useRef();

  const cardRefs = useRef(new Array());

  const shadowControls = useAnimation();

  useEffect(() => {
    if (selectedCard) {
      shadowControls.start("selected");
    } else {
      shadowControls.start("initial");
    }
  }, [selectedCard]);

  useEffect(() => {
    const { scrollWidth, clientWidth } = containerRef.current;
    const halfScroll = (scrollWidth - clientWidth) / 2;
    containerRef.current.scrollLeft = halfScroll;
  }, [containerRef.current]);

  useEffect(() => {
      window.addEventListener("mouseup", handleMouseUpOutsideContainer);
      return () => {
        window.removeEventListener("mouseup", handleMouseUpOutsideContainer);
      };
  }, []);

  const handleMouseUpOutsideContainer = () => {
    setDragStart((prev) => ({ ...prev, isDragging: false }));
  };

  const handleMouseDown = (e) => {
    setDragStart({
      startX: e.pageX - containerRef.current.offsetLeft,
      startScrollLeft: containerRef.current.scrollLeft,
      isDragging: true,
    });
  };

  const handleMouseMove = (e) => {
    if (!isDragging || selectedCard) return;
    const x = e.pageX - containerRef.current.offsetLeft;
    const walk = x - startX;
    containerRef.current.scrollLeft = startScrollLeft - walk;
  };

  const selectCard = (card) => {
    setSelectedCard(selectedCard ? null : card);

    if (card && !selectedCard) {
      cardRefs.current[card - 1].scrollIntoView({
        behavior: "smooth",
        block: "nearest",
        inline: "center",
      });
    }
  };

  const handleCardMouseUp = (e, card) => {
    if (isDragging) {
      const x = e.pageX - containerRef.current.offsetLeft;
      const walk = x - startX;
      if (Math.abs(walk) < 5) selectCard(card);
    } else selectCard(card);
  };

  return (
    <div
      onMouseDown={handleMouseDown}
      onMouseUp={() => setDragStart((prev) => ({ ...prev, isDragging: false }))}
      onMouseMove={handleMouseMove}
      style={gridStyles}
    >
      <div
        className="flashcards__container"
        ref={containerRef}
        style={cardContainerStyles}
      >
        {cards.map((card, i) => (
          <motion.div
            ref={(el) => cardRefs.current.push(el)}
            onMouseUp={(e) => handleCardMouseUp(e, card.id)}
            variants={cardVariants}
            animate={selectedCard === card.id ? "selected" : "notSelected"}
            custom={selectedCard ? selectedCard - card.id : 0}
            style={{ ...cardStyles, backgroundImage: `url(${card.image})` }}
          >
            <Stack
              style={{
                height: "100%",
                borderRadius: "15px",
                overflow: "hidden",
              }}
              alignItems={"center"}
              component={motion.div}
              variants={shadowVariants}
              initial="initial"
              animate={shadowControls}
              transition={{ duration: 1 }}
            >
              <AnimatePresence mode="wait">
                {selectedCard === card.id ? (
                  <motion.div
                    initial={{ y: -100 }}
                    animate={{ y: 100 }}
                    exit={{ y: -100 }}
                    transition={{ duration: 1 }}
                  >
                    <Button variant="outlined" style={viewButtonStyles}>
                      <Typography style={buttonTextStyles}>View</Typography>{" "}
                      <VisibilityIcon />
                    </Button>
                  </motion.div>
                ) : (
                  <Typography
                    align="center"
                    style={portofolioNameStyles}
                    component={motion.div}
                    initial={{ y: -100 }}
                    animate={{ y: 0 }}
                    exit={{ y: -100 }}
                    transition={{ duration: 1 }}
                  >
                    {card.name}
                  </Typography>
                )}
              </AnimatePresence>
            </Stack>
          </motion.div>
        ))}
      </div>
    </div>
  );
};

export default Flashcards;
